import React from "react";
import "./App.css";

/**
 * Header
 * - Logo
 * - Nav Items (Right Side)
 * - Car
 *
 * Body
 * - Search Bar
 * - RestaurantCard
 *    - Image
 *    - Name
 *    - Rating
 *    - Cuisines
 *
 * Footer
 *    - links
 *    - copyright
 */
const Title = () => {
  // return <h1 className="header-name">HungryFoods</h1>;
  return (
    <a href="/">
      <img className="logo" src="hungry-foods-logo.png" alt="app logo" />
    </a>
  );
};

const Header = () => {
  return (
    <div className="App-header">
      <Title />
      <div className="nav-items">
        <ul>
          <li>Home</li>
          <li>Aobut</li>
          <li>Contact</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const Body = () => {
  return <h1>Body</h1>;
};

const Footer = () => {
  return <h1>Footer</h1>;
};

const AppLayout = () => {
  return (
    <React.Fragment>
      <Header />
      <Body />
      <Footer />
      </React.Fragment>
  );
};

function App() {
  return <AppLayout />;
}

export default App;
